      SELECT ALL - - col0 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT + - col2 / + 89 BETWEEN + + 69 AND - - col0 + col2;
  - name: tab2

outputs:
  - name: q9132.out
    data: |
      46
      64
      75
